import * as WebBrowser from 'expo-web-browser';
import { Platform } from 'react-native';
import * as Application from 'expo-application';

const credentialsModule = require('./AuthCredentials');

export default async function Logout(loginState){
    loginState = !loginState
    const returnUrl = `${Application.applicationId}://${credentialsModule.domainWithoutHttps}/${Platform.OS}/${Application.applicationId}/callback`
    await WebBrowser.openBrowserAsync(`${credentialsModule.domain}/v2/logout?client_id=${credentialsModule.auth0ClientId}&returnTo=${returnUrl}`)
    return loginState
}
